import sc3
import math

if len(全日) !=len(shiftdef) or len(全日) !=len(全スタッフ):
    raise ValueError("全日とシフト数 または、全日と全スタッフ数が一致していません。")
if math.sqrt(len(全日)) not in range(2,11,1):
    raise ValueError("数独サポートは、4x4,9x9...100x100です。")
blocks=int(math.sqrt(len(全日)))
for day in 全日: #列制約
	for シフト in shiftdef.keys():
		V=[]
		for 人 in 全スタッフ:
			V.append(sc3.GetShiftVar(人,day,シフト))
		sc3.AddHard(sc3.SeqLE(1,1,V),'')
for 人 in 全スタッフ: #行制約
	for  シフト in shiftdef.keys():
		V=[]
		for  day in 全日:
			V.append(sc3.GetShiftVar(人,day,シフト))
		sc3.AddHard(sc3.SeqLE(1,1,V),'')
for 人 in range(0,len(全スタッフ),blocks): #ブロック制約
	for シフト in shiftdef.keys():
		for  day in range(0,len(全日),blocks):
			V=[]
			for  i  in range(blocks):
				for  j in range(blocks):
					V.append(sc3.GetShiftVar(人+i,day+j,シフト))
			sc3.AddHard(sc3.SeqLE(1,1,V),'')
